pragma solidity ^0.4.25;

// It's important to avoid vulnerabilities due to numeric overflow bugs
// OpenZeppelin's SafeMath library, when used correctly, protects agains such bugs
// More info: https://www.nccgroup.trust/us/about-us/newsroom-and-events/blog/2018/november/smart-contract-insecurity-bad-arithmetic/

import "../node_modules/openzeppelin-solidity/contracts/math/SafeMath.sol";
import "./FlightSuretyData.sol";

/************************************************** */
/* FlightSurety Smart Contract                      */
/************************************************** */
contract FlightSuretyApp {
    using SafeMath for uint256; // Allow SafeMath functions to be called for all uint256 types (similar to "prototype" in Javascript)

    /********************************************************************************************/
    /*                                       DATA VARIABLES                                     */
    /********************************************************************************************/
    bool private operational = true;                                    // Blocks all state changes throughout the contract if false

    // Flight status codees
    uint8 private constant STATUS_CODE_UNKNOWN = 0;
    uint8 private constant STATUS_CODE_ON_TIME = 10;
    uint8 private constant STATUS_CODE_LATE_AIRLINE = 20;
    uint8 private constant STATUS_CODE_LATE_WEATHER = 30;
    uint8 private constant STATUS_CODE_LATE_TECHNICAL = 40;
    uint8 private constant STATUS_CODE_LATE_OTHER = 50;

    uint256 private AIRLINE_PARTICIPATION_FEE =  10 ether;
    uint256 private INSURANCE_PREMIUM =  1 ether;   //
    uint256 private CONSENSUS = 4;                      //max number of airlines without consensus rule


    address private contractOwner;          // Account used to deploy contract

    FlightSuretyData flightData; //data contract

    mapping(address => uint256) public votesPerAirline;
    mapping(address => mapping(address => bool)) public hasVoted;
    mapping(address => bool) public isInQueue;
    mapping(address => string) public airlineNames;

    /********************************************************************************************/
    /*                                       Events                                             */
    /********************************************************************************************/

    event AirlineAddedToRegisterationQueue(address indexed airline, uint256 votesRatio);
    event AirlineRegisteredWithoutVotes(address indexed airline);
    event AirlineRegisteredWithVotes(address indexed airline, uint256 votes);
    event AirlineVoted(address indexed airlineVoting, address indexed airlineVoted);
    event AirlineFullyFunded(address indexed airline, uint256 value);
    event FlightRegistered(address indexed airline, string flightNumber, string timeStamp);
    event PassengerRegistered(address indexed passenger, string name, address airlineAddress, bytes32 key);
    event InsurancePurchased(address indexed passenger, bytes32 flightNumber, uint256 amount);

    /********************************************************************************************/
    /*                                       FUNCTION MODIFIERS                                 */
    /********************************************************************************************/

    // Modifiers help avoid duplication of code. They are typically used to validate something
    // before a function is allowed to be executed.

    /**
    * @dev Modifier that requires the "operational" boolean variable to be "true"
    *      This is used on all state changing functions to pause the contract in 
    *      the event there is an issue that needs to be fixed
    */
    modifier isOperational() 
    {
         // Modify to call data contract's status
        require(operational, "Contract is currently not operational");  
        _;  // All modifiers require an "_" which indicates where the function body will be added
    }

    /**
    * @dev Modifier that requires the "ContractOwner" account to be the function caller
    */
    modifier onlyContractOwner()
    {
        require(msg.sender == contractOwner, "Caller is not contract owner");
        _;
    }

    modifier onlyRegisteredAirline(){
        bool isRegistered;
        (,isRegistered,,)= flightData.getAirlineData(msg.sender);
        require(isRegistered, "Airline not registered");
        _;
    }


    modifier addressNotUsed(address _address){
        bool isAirlineRegistered;
        bool isPassengerRegistered;
        (,isAirlineRegistered,,)= flightData.getAirlineData(_address);
        (,isPassengerRegistered,) = flightData.getPassengerData(_address);
        require(!isAirlineRegistered, "This address is already taken by another airline");
        require(!isPassengerRegistered, "This address is already taken by another passenger");
        _;
    }

    modifier hasNotAlreadyVoted(address _airlineAddress) 
    {
         // Modify to call data contract's status
        require(!hasVoted[msg.sender][_airlineAddress], "You have already voted on this airline");  
        _;  // All modifiers require an "_" which indicates where the function body will be added
    }

    modifier onlyInQueue(address _airlineAddress) 
    {
         // Modify to call data contract's status
        require(isInQueue[_airlineAddress], "This airline is not in registration queue");  
        _;  // All modifiers require an "_" which indicates where the function body will be added
    }


    modifier onlyRegisteredPassenger(){
        bool isRegistered;
        (,isRegistered,) = flightData.getPassengerData(msg.sender);
        require(isRegistered, "Passenger not registered");
        _;
    }

    /********************************************************************************************/
    /*                                       CONSTRUCTOR                                        */
    /********************************************************************************************/

    /**
    * @dev Contract constructor
    *
    */
    constructor(address _flightDataContractAddress) 
    public 
    {
        contractOwner = msg.sender;
        flightData = FlightSuretyData(_flightDataContractAddress);
    }

    /********************************************************************************************/
    /*                                       UTILITY FUNCTIONS                                  */
    /********************************************************************************************/

        /**
    * @dev Get operating status of contract
    *
    * @return A bool that is the current operating status
    */      
    function getOperationalStatus() 
    external 
    view 
    returns(bool) 
    {
        return operational;
    }


    /**
    * @dev Sets contract operations on/off
    *
    * When operational mode is disabled, all write transactions except for this one will fail
    */    
    function setOperatingStatus(bool mode) 
    external
    onlyContractOwner 
    {
        operational = mode;
    }

    /* @dev generate key using keccak256
    */
    function generateKey(address airlineAddress, string flightNumber, string timeStamp)
    internal
    view
    isOperational
    returns(bytes32) 
    {
        return keccak256(abi.encodePacked(airlineAddress, flightNumber, timeStamp));
    }


    /********************************************************************************************/
    /*                                     SMART CONTRACT FUNCTIONS                             */
    /********************************************************************************************/


   /**
    * @dev Add an airline to the registration queue
    *
    */   
    function registerAirline(string name, address airlineAddress)
    external
    isOperational
    onlyRegisteredAirline
    addressNotUsed(airlineAddress)
    {
        bool check = flightData.numRegisteredAirlines() < CONSENSUS;
        if (check) {
            flightData.registerAirline(name, airlineAddress);
            airlineNames[airlineAddress] = name;
            emit AirlineRegisteredWithoutVotes(airlineAddress);
        } else {
            uint256 votesPercentage;
            votesPercentage = votesPerAirline[airlineAddress].mul(100).div(flightData.numRegisteredAirlines());
            if (votesPercentage >= 50) {
                flightData.registerAirline(name, airlineAddress);
                airlineNames[airlineAddress] = name;
                emit AirlineRegisteredWithVotes(airlineAddress, votesPerAirline[airlineAddress]);
            } else {
                isInQueue[airlineAddress] = true;
                airlineNames[airlineAddress] = name;
                emit AirlineAddedToRegisterationQueue(airlineAddress, votesPercentage);
            }
        }
    }


    function voteAirline(address airlineAddress)
    external
    isOperational
    onlyRegisteredAirline
    hasNotAlreadyVoted(airlineAddress)
    onlyInQueue(airlineAddress)
    {

        bool canParticipate;
        (,,canParticipate,) = flightData.getAirlineData(msg.sender);
        require(canParticipate, "Airline has not participated yet");
        hasVoted[msg.sender][airlineAddress] = true;
        votesPerAirline[airlineAddress] = votesPerAirline[airlineAddress].add(1);
        emit AirlineVoted(msg.sender, airlineAddress);
    }

    function getAirlineRegistrationStatus(address _airlineAddress)
    external
    view
    isOperational
    returns(bool)
    {
        bool isRegistered;
        (,isRegistered,,) = flightData.getAirlineData(_airlineAddress);
        return isRegistered;
    }


    function checkIfVoted(address votingAirline, address votedAirline) 
    external
    view
    isOperational
    returns(bool)
    {
        return hasVoted[votingAirline][votedAirline];
    }


    function fundAirline()
    public
    payable
    isOperational
    onlyRegisteredAirline
    {
        //require(amount >= AIRLINE_PARTICIPATION_FEE, "Make sure you send the correct participation fee");
        //address dataContractAddress = address(uint160(address(flightData)));
        //dataContractAddress.transfer(amount);
        //flightData.fund(msg.sender, amount);
        flightData.setParticipationStatus(msg.sender, true);
        emit AirlineFullyFunded(msg.sender, msg.value);
    }

   /**
    * @dev Register a future flight for insuring.
    *
    */  
    function registerFlight(string flightNumber, string timeStamp)
    external
    isOperational
    onlyRegisteredAirline
    {
        bool canParticipate;
        (,,canParticipate,) = flightData.getAirlineData(msg.sender);
        require(canParticipate, "Airline is not fully funded and can't participate");
        bytes32 key = generateKey(msg.sender, flightNumber, timeStamp);
        flightData.registerFlight(msg.sender, key, flightNumber, timeStamp, STATUS_CODE_ON_TIME);
        emit FlightRegistered(msg.sender, flightNumber, timeStamp);

    }

    function registerPassenger(string _name, address _airlineAddress, string flightNumber, string timeStamp)
    external
    payable
    isOperational
    addressNotUsed(msg.sender)
    {
        bytes32 key = generateKey(_airlineAddress, flightNumber, timeStamp);
        bool isRegistered;
        (, isRegistered, , , ) = flightData.getFlightDetails(key);
        require(isRegistered, "This flight does not exist");
        flightData.registerPassenger(_airlineAddress, _name, msg.sender, key, msg.value);
        address(flightData).transfer(msg.value);
        emit PassengerRegistered(msg.sender, _name, _airlineAddress, key);
    }


    function updateFlightStatusCode(address _airlineAddress, string flightNumber, string timeStamp, uint8 _statusCode)
    external
    isOperational
    {      
        bytes32 key = generateKey(_airlineAddress, flightNumber, timeStamp);
        bool isRegistered;
        (, isRegistered, , , ) = flightData.getFlightDetails(key);
        require(isRegistered, "This flight does not exist");
        flightData.updateFlightStatusCode(key, _statusCode);
    }


    function buyInsurance(address _airlineAddress, string flightNumber, string timeStamp)
    external
    payable
    isOperational
    onlyRegisteredPassenger
    {   
        bytes32 key = generateKey(_airlineAddress, flightNumber, timeStamp);
        bool isRegistered;
        (, isRegistered, , , ) = flightData.getFlightDetails(key);
        require(isRegistered, "This flight does not exist");
        require(!flightData.getInsuranceStatus(msg.sender, key), "Passenger already insured for the this flight");
        require(INSURANCE_PREMIUM == 1 ether, "Incorrect Insurance premium paid");
        address(flightData).transfer(msg.value);
        flightData.buyInsurance(msg.sender, _airlineAddress, key, msg.value);
    }

    function checkPassengerInsuranceStatus(address passengerAddress, address _airlineAddress, string flightNumber, string timeStamp)
    external
    isOperational
    onlyRegisteredAirline
    view
    returns(bool)
    {   
        bytes32 flightKey = generateKey(_airlineAddress, flightNumber, timeStamp);
        return flightData.checkPassengerInsuranceStatus(passengerAddress, flightKey);
    }

    // function getFlightsPerAirline(address _airlineAddress)
    // external
    // view
    // isOperational
    // onlyRegisteredAirline
    // returns(bytes32[] memory)
    // {
    //     mapping(address => bytes32[]) memory map = flightData.flightsPerAirline();
    //     return map[_airlineAddress];
    // }


   /**
    * @dev Called after oracle has updated flight status
    *
    */  
    function processFlightStatus(address airline, string flightNumber, string timestamp, uint8 statusCode, uint8 factor)
    internal
    {
        bytes32 key = generateKey(airline, flightNumber, timestamp);
        flightData.updateFlightStatusCode(key, statusCode);

        if(statusCode == STATUS_CODE_LATE_AIRLINE){
            flightData.creditAllInsureesPerFlight(key, factor);
            oracleResponses[key].isOpen = false;
        }
    }


    // Generate a request for oracles to fetch flight information
    function fetchFlightStatus(address airline, string flight, string timestamp)
    external
    isOperational
    onlyContractOwner
    {
        uint8 index = getRandomIndex(msg.sender);

        // Generate a unique key for storing the request
        bytes32 key = keccak256(abi.encodePacked(index, airline, flight, timestamp));
        oracleResponses[key] = ResponseInfo({
                                                requester: msg.sender,
                                                isOpen: true
                                            });

        emit OracleRequest(index, airline, flight, timestamp);
    } 


// region ORACLE MANAGEMENT

    // Incremented to add pseudo-randomness at various points
    uint8 private nonce = 0;    

    // Fee to be paid when registering oracle
    uint256 public constant REGISTRATION_FEE = 1 ether;

    // Number of oracles that must respond for valid status
    uint256 private constant MIN_RESPONSES = 3;


    struct Oracle {
        bool isRegistered;
        uint8[3] indexes;        
    }

    // Track all registered oracles
    mapping(address => Oracle) private oracles;

    // Model for responses from oracles
    struct ResponseInfo {
        address requester;                              // Account that requested status
        bool isOpen;                                    // If open, oracle responses are accepted
        mapping(uint8 => address[]) responses;          // Mapping key is the status code reported
                                                        // This lets us group responses and identify
                                                        // the response that majority of the oracles
    }

    // Track all oracle responses
    // Key = hash(index, flight, timestamp)
    mapping(bytes32 => ResponseInfo) private oracleResponses;

    // Event fired each time an oracle submits a response
    event FlightStatusInfo(address airline, string flight, string timestamp, uint8 status);

    event OracleReport(address airline, string flight, string timestamp, uint8 status);

    // Event fired when flight status request is submitted
    // Oracles track this and if they have a matching index
    // they fetch data and submit a response
    event OracleRequest(uint8 index, address airline, string flight, string timestamp);


    // Register an oracle with the contract
    function registerOracle()
    external
    payable
    isOperational
    {
        // Require registration fee
        require(msg.value >= REGISTRATION_FEE, "Registration fee is required");

        // Check if address has not registered Oracle before
        require(!oracles[msg.sender].isRegistered, "Oracle already registered");


        uint8[3] memory indexes = generateIndexes(msg.sender);

        oracles[msg.sender] = Oracle({
                                        isRegistered: true,
                                        indexes: indexes
                                    });
    }

    function getMyIndexes()
    view
    external
    returns(uint8[3])
    {
        require(oracles[msg.sender].isRegistered, "Not registered as an oracle");

        return oracles[msg.sender].indexes;
    }




    // Called by oracle when a response is available to an outstanding request
    // For the response to be accepted, there must be a pending request that is open
    // and matches one of the three Indexes randomly assigned to the oracle at the
    // time of registration (i.e. uninvited oracles are not welcome)
    function submitOracleResponse(uint8 index, address airline, string flight, string timestamp, uint8 statusCode)
    external
    {
        require((oracles[msg.sender].indexes[0] == index) || (oracles[msg.sender].indexes[1] == index) || (oracles[msg.sender].indexes[2] == index), "Index does not match oracle request");


        bytes32 key = keccak256(abi.encodePacked(index, airline, flight, timestamp)); 
        require(oracleResponses[key].isOpen, "Flight or timestamp do not match oracle request");

        oracleResponses[key].responses[statusCode].push(msg.sender);

        // Information isn't considered verified until at least MIN_RESPONSES
        // oracles respond with the *** same *** information
        emit OracleReport(airline, flight, timestamp, statusCode);
        if (oracleResponses[key].responses[statusCode].length >= MIN_RESPONSES) {

            emit FlightStatusInfo(airline, flight, timestamp, statusCode);

            // Handle flight status as appropriate
            processFlightStatus(airline, flight, timestamp, statusCode, 50);
        }
    }

    // Returns array of three non-duplicating integers from 0-9
    function generateIndexes(address account)
    internal
    returns(uint8[3])
    {
        uint8[3] memory indexes;
        indexes[0] = getRandomIndex(account);

        indexes[1] = indexes[0];
        while(indexes[1] == indexes[0]) {
            indexes[1] = getRandomIndex(account);
        }

        indexes[2] = indexes[1];
        while((indexes[2] == indexes[0]) || (indexes[2] == indexes[1])) {
            indexes[2] = getRandomIndex(account);
        }

        return indexes;
    }

    // Returns array of three non-duplicating integers from 0-9
    function getRandomIndex(address account)
    internal
    returns (uint8)
    {
        uint8 maxValue = 10;

        // Pseudo random number...the incrementing nonce adds variation
        uint8 random = uint8(uint256(keccak256(abi.encodePacked(blockhash(block.number - nonce++), account))) % maxValue);

        if (nonce > 250) {
            nonce = 0;  // Can only fetch blockhashes for last 256 blocks so we adapt
        }

        return random;
    }

// endregion

}

